import React from "react";
import {Table, Input, FormGroup, Label, Col, Card, CardBody} from "reactstrap";
import {Edit, Trash2} from 'react-feather';

function HeaderColumn({key}) {
        return <td>{key}</td>


}
export default class TableComponent extends React.Component {
    render() {
        let data = this.props.data
        return (
            <Col sm="12">
                <Card>
                    <CardBody>
                        <Table responsive>
                            <thead>
                            <tr>
                                {Object.keys(data[0]).forEach(function(key) {
                                    console.log(key)
                                    return (<HeaderColumn key={key}/>)
                                })}
                            </tr>
                            </thead>

                        </Table>
                    </CardBody>
                </Card>
            </Col>

        );
    }
}
